import React from 'react';
import logo from './logo.svg';
import './App.css';
import Main from './components/Main/Main';
import Diplomes from './components/Diplomes/Diplomes';

function App() {
  return (
    <div className="App">
      <body>
        <Main />
        <Diplomes />
      </body>
    </div>
  );
}

export default App;
